import './App.css';
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/Button';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch } from '@fortawesome/free-solid-svg-icons';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

/* Components */
import Features from './components/Features';
import Contact from './components/Contact';
import AuthPage from './components/AuthPage'; // Import AuthPage component
import Menu from './components/Menu';  // Correct the import here

axios.defaults.xsrfCookieName = 'csrftoken';
axios.defaults.xsrfHeaderName = 'X-CSRFToken';
axios.defaults.withCredentials = true;

const client = axios.create({
  baseURL: "http://127.0.0.1:8000"
});

function App({ setCurrentUser }) {
  const [currentUser, setCurrentUserState] = useState();

  useEffect(() => {
    client.get("/api/user")
      .then(function(res) {
        setCurrentUserState(true);
      })
      .catch(function(error) {
        setCurrentUserState(false);
      });
  }, []);

  function submitLogout(e) {
    e.preventDefault();
    client.post(
      "/api/logout",
      { withCredentials: true }
    ).then(function(res) {
      setCurrentUserState(false);
      setCurrentUser(false);  // Update currentUser state in the RoutesConfig
    });
  }

  if (currentUser) {
    return (
      <div className='header'>
        <Navbar className='navbar-custom'>
          <Container>
            <Navbar.Brand><b>After login page</b></Navbar.Brand>
            <Navbar.Toggle />
            <Navbar.Collapse className="justify-content-end">
              <Navbar.Text>
                <form onSubmit={e => submitLogout(e)}>
                  <Button className='logout-button'  type="submit" variant="light">Log out</Button>
                </form>
              </Navbar.Text>
            </Navbar.Collapse>
          </Container>
        </Navbar>
        <div className="button-container">
          <button className="button support">Support</button>
          <button className="button community">Community</button>
          <Link to="/features" className="button features">Features</Link>
          <Link to="/Contact" className="button contact-us"> Contact Us</Link>
          <button className="button language">English</button>
          <button className="button search-button">
            <FontAwesomeIcon icon={faSearch} />
          </button>
        </div>
        <Menu />
        <div className="home">
          <img src="/media/pexels-googledeepmind-17485633.jpg" alt="Sample" />
        </div>
      </div>
    );
  }

  return (
    <div>
      <Navbar className='navbar-custom'>
        <Container>
          <Navbar.Brand>My Data Project</Navbar.Brand>
          <Navbar.Toggle />
          <Navbar.Collapse className="justify-content-end">
            <Navbar.Text>
              <Link to="/auth" id="form_btn" variant="light">Login / Register</Link>
            </Navbar.Text>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <div className="button-container">
        <button className="button support">Support</button>
        <button className="button community">Community</button>
        <Link to="/features" className="button features">Features</Link>
        <Link to="/Contact" className="button contact-us">Contact Us</Link>
        <button className="button language">English</button>
        <button className="button search-button">
          <FontAwesomeIcon icon={faSearch} />
        </button>
      </div>
      <Menu />
    </div>
  );
}

function RoutesConfig() {
  const [currentUser, setCurrentUser] = useState(false); // Define state for currentUser

  return (
    <Router>
      <Routes>
        <Route path="/" element={<App setCurrentUser={setCurrentUser} />} /> {/* Pass setCurrentUser as a prop */}
        <Route path="/auth" element={<AuthPage setCurrentUser={setCurrentUser} />} /> {/* Pass setCurrentUser as a prop */}
        <Route path="/features" element={<Features />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
    </Router>
  );
}

export default RoutesConfig;
